<div class="entities" style="line-height: 2.5; direction: ltr">Targeting MET and vascular endothelial growth factor receptor signaling in castration-resistant prostate cancer . Effective management of bone metastases in men with castration-resistant prostate cancer ( CRPC ) remains an important unmet medical need . MET and vascular endothelial growth factor receptor ( VEGFR ) are rational targets for intervention in CRPC . Clinical trials involving agents that inhibit one but not both pathways have reported modest activity and no improvement in overall survival . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08875
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is an oral multitargeted tyrosine kinase inhibitor that inhibits both MET and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . A phase II randomized discontinuation study involving subjects with CRPC demonstrated that cabozantinib therapy is associated with improvement in bone scans , bone turnover markers , and pain response , but with significant adverse events leading to dose reduction and treatment discontinuation . Lower doses of cabozantinib retain high levels of activity with less toxicity . Ongoing phase III clinical trials will define the role of cabozantinib in CRPC . We summarize the rationale for targeting MET and VEGFR pathways in CRPC and the clinical data available to date .</div>

 ) . In contrast , these inhibitors have shown limited efficacy in glioblastoma , where a distinct

 cells transformed with the EGFRvIII mutant were relatively resistant to gefitinib and erlotinib in vitro but proved sensitive to HKI - 272 . These findings suggest a therapeutic strategy for cancers harboring the EGFRvIII mutation .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">A transgenic platform for testing drugs intended for reversal of cardiac remodeling identifies a novel 11βHSD1 inhibitor rescuing hypertrophy independently of re-vascularization . RATIONALE : Rescuing adverse myocardial remodeling is an unmet clinical goal and , correspondingly , pharmacological means for its intended reversal are urgently needed . OBJECTIVES : To harness a newly-developed experimental model recapitulating progressive heart failure development for the discovery of new drugs capable of reversing adverse remodeling . METHODS AND RESULTS : A 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - based conditional transgenic system was employed in which an induced perfusion deficit and a resultant compromised cardiac function lead to progressive remodeling and eventually heart failure . Ability of candidate drugs administered at sequential remodeling stages to reverse hypertrophy , enlarged LV size and improve cardiac function was monitored . Arguing for clinical relevance of the experimental system , clinically-used drugs operating on the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00797
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - Angiotensin - DB04630 - System ( RAAS ) , namely , the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P12821
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor Enalapril and the direct renin inhibitor Aliskerin fully reversed remodeling . Remodeling reversal by these drugs was not accompanied by neovascularization and reached a point-of-no-return . Similarly , the PPARγ agonist Pioglitazone was proven capable of reversing all aspects of cardiac remodeling without affecting the vasculature . Extending the arsenal of remodeling-reversing drugs to pathways other than RAAS , a specific inhibitor of 11β - hydroxy-steroid dehydrogenase type 1 ( 11β HSD 1 ) , a key enzyme required for generating active glucocorticoids , fully rescued myocardial hypertrophy . This was associated with mitigating the hypertrophy-associated gene signature , including reversing the myosin heavy chain isoform switch but in a pattern distinguishable from that associated with neovascularization-induced reversal . CONCLUSIONS : A system was developed suitable for identifying novel remodeling-reversing drugs operating in different pathways and for gaining insights into their mechanisms of action , exemplified here by uncoupling their vascular affects .</div>

 ) and Chromogranin A were normally expressed by FGPs . FGPs did not express HLA II DR . FGPs did not react with an anti -

 is an oral MET /

 inhibitor . A recent phase II study of cabozantinib ( 100 mg daily ) showed improved bone scans in subjects with metastatic castration-resistant prostate cancer ( mCRPC ) , but adverse events ( AE ) caused frequent dose reductions . This study was designed to determine the efficacy and tolerability of cabozantinib at lower starting doses . EXPERIMENTAL DESIGN : An adaptive design was used to determine the lowest active daily dose among 60 , 40 , and 20 mg . The primary endpoint was week 6 bone scan response , defined as ≥ 30 % decrease in bone scan lesion area . The secondary endpoint was change in circulating tumor cells ( CTC ) . RESULTS : Among 11 evaluable subjects enrolled at 40 mg , there were 9 partial responses ( PR ) , 1 complete response , and 1 stable disease ( SD ) . Of 10 subjects subsequently enrolled at 20 mg , there were 1 PR , 5 SDs , and 4 with progressive disease . Among 13 subjects enrolled on the 40 mg expansion cohort , there were 6 PRs and 7 SDs . No subjects required dose reduction or treatment interruption at 6 or 12 weeks ; 3 subjects at dose level 0 discontinued due to AEs by 12 weeks . At 40 mg , median treatment duration was 27 weeks . 58 % of subjects with ≥ 5 CTCs / 7.5 mL at baseline converted to &lt; 5 . CONCLUSIONS :

 40 mg daily was associated with better tolerability than previously reported for cabozantinib 100 mg daily . These observations informed the design of phase III studies of cabozantinib in mCRPC .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Functional characteristics of calcium-sensitive adenylyl cyclase of ciliate Tetrahymena pyriformis ] . DB01373 - sensitive forms of adenylyl cyclase ( AC ) were revealed in most vertebrates and invertebrates and also in some unicellular organisms , in particular ciliates . We have shown for the first time that calcium cations influence the AC activity of ciliate Tetrahymena pyriformis . These cations at the concentrations of 0.2- 20 microM stimulated the enzyme activity , and maximum of catalytic effect was observed at 2 microM Ca2 + . DB01373 cations at a concentrations of 100 microM or higher inhibited the AC activity . P62158 antagonists W - 5 and W - 7 at the concentrations of 20-100 microM inhibited the catalytic effect induced by 5 microM Ca2 + and blocked the effect at higher concentrations of Ca2 + .

<div class="entities" style="line-height: 2.5; direction: ltr">Synaptic and photoreceptor components in retinal pigment epithelial cell transplanted retinas of Royal College of Surgeons dystrophic rats . Plexiform layer synaptic and photoreceptor cell components were investigated in retinas of Royal College of Surgeons ( RCS ) dystrophic rats transplanted with normal retinal pigment epithelial ( Q96AT9 ) cells by immunocytochemistry using previously characterized monoclonal antibodies . In retinas of normal adult rats and Q96AT9 - cell transplanted retinas of 4 month-old RCS rats , HNK - 1 , a marker for a carbohydrate of the neural cell adhesion molecule ( N - P62158 ) , was detected immunocytochemically in the inner and outer plexiform layers and ganglion cell bodies and their axons . HNK - 1 was also detected in the inner plexiform layer of nontreated retinas of 4 month-old RCS rats , but was reduced to scattered patches in the outer plexiform layer . In addition , immunoreactivity for the SVP - 38 antibody recognizing synaptophysin was found in both plexiform layers of normal adult rat retinas and Q96AT9 - transplanted retinas of 4 month-old RCS rats . Furthermore , photoreceptor cell bodies and their inner and outer segments were immunostained for the opsin monoclonal antibody 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P07949

</mark>
 - P1 in retinas of normal adult rats and Q96AT9 - cell transplanted retinas of 4 month-old RCS rats . However , in nontreated retinas of 4 - month-old RCS rats , only immunostained debris material was detected . These results strongly suggest that normal Q96AT9 transplants not only rescue photoreceptor cells in RCS rats , but also maintain an essential functional capacity , in this case , synaptic components in the plexiform layers .</div>
